Actionscript.script:
onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "狂瀑扎.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "狂瀑扎子弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

	子弹属性.子弹速度 = 30;
	子弹属性.Z轴攻击范围 = 60;
	子弹属性.击倒率 = 1;
	子弹属性.水平击退速度 = 18;
	子弹属性.伤害类型 = "魔法";

	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this,2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.水平击退速度 = 18;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	if (_parent._parent.刀 != "")
	{
		_parent._parent.根据模式重新读取武器加成("兵器");
	}
	this.onUnload = function()
	{
		if (_parent._parent.状态 == "技能")
		{
			_parent._parent.根据模式重新读取武器加成("空手");
		}
		else if (_parent._parent.攻击模式 != "")
		{
			_parent._parent.根据模式重新读取武器加成(_parent._parent.攻击模式);
		}
	};
}

onClipEvent(enterFrame){
	if(_parent._parent.技能名 == "狂瀑扎"){
		_parent.攻击时移动(2,5)
	}else{
   		_parent.攻击时移动(10,25);
	}
}

onClipEvent(enterFrame){
	if(_parent._parent.技能名 == "狂瀑扎"){
		_parent.攻击时移动(20,30);
	}else{
   		_parent.攻击时移动(120,150);
	}
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 and (_parent._parent.浮空 or (_parent._parent.技能浮空 == true)))
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
